import React, { Fragment } from 'react'
import { Link } from 'react-router-dom';
import profile from './../../assets/images/profile.jpg'

//Create Home Component
function Home() {

    return (<Fragment>

        <div>
            <h1 className="text-danger" style={{ fontSize: '60px' }}>MS DHONI</h1><p>He's the best captain we've had

                No cricket captain in the past has been as succesful as Dhoni across all formats of cricket. As of today, his captaincy boasts of two world titles in 50-over ODI cricket, one world title in the T20 format besides Champions League and IPL, where he holds two titles in each format.</p>
            <img src={profile} className="card-img-top" style={{ heiht: '200px', width: '300px', position: 'relative', left: '1000px' }} />

        </div>


    </Fragment>)

}

export default Home;
